def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        if bins[i] >= item:
            if bins[i] == 0:
                priorities[i] = 0.0
            elif bins[i] == item:
                priorities[i] = 1.0
            else:
                priorities[i] = (item + bins[i]) / (2 * bins[i])
        else:
            priority_diff = (item - bins[i]) / item
            if priority_diff < 0.05:
                priorities[i] = 0.1
            elif priority_diff >= 0.05 and priority_diff < 0.2:
                priorities[i] = 0.3
            elif priority_diff >= 0.2 and priority_diff < 0.4:
                priorities[i] = 0.5
            elif priority_diff >= 0.4 and priority_diff < 0.6:
                priorities[i] = 0.7
            elif priority_diff >= 0.6 and priority_diff < 0.8:
                priorities[i] = 0.9
            else:
                priorities[i] = 0.95

    max_priority = np.max(priorities)
    min_priority = np.min(priorities)

    for j in range(len(priorities)):
        if priorities[j] == max_priority:
            priorities[j] = 1.0
        elif priorities[j] == min_priority:
            priorities[j] = 0.0
        else:
            priorities[j] = (priorities[j] - min_priority) / (max_priority - min_priority)

    return priorities
